const CACHE_NAME="attention-lab-v3",CORE=["/css/attention.css","/js/attention/slow-look-timer.js","/js/attention/make-it-strange.js","/js/attention/art-wheel.js","/js/attention/art-elements-wheel.json","/lab/aesthetic-break-01/"];self.addEventListener("install",e=>{e.waitUntil(caches.open(CACHE_NAME).then(e=>e.addAll(CORE))),self.skipWaiting()}),self.addEventListener("activate",e=>{e.waitUntil(caches.keys().then(e=>Promise.all(e.map(e=>e===CACHE_NAME?null:caches.delete(e))))),self.clients.claim()}),self.addEventListener("fetch",e=>{const t=e.request;e.respondWith(caches.match(t).then(e=>e||fetch(t).then(e=>{if(t.method==="GET"&&e.status===200&&e.type==="basic"){const n=e.clone();caches.open(CACHE_NAME).then(e=>e.put(t,n))}return e})).catch(()=>caches.match("/lab/aesthetic-break-01/")))})